export default function Name() {
    const [name,setName]= useState('')
    return(
        <div>
            <input
                value={name}
                placeholder={undefined}
                onChange={e=>setName(e.target.value)}
                onClick={e=>e.target.setSelectionRange(0,e.target.value)}
            />
        </div>
    )    
}
